import React, { Component } from 'react';

export default class App extends Component {

  constructor(){
    super();

    this.state = {
      user: [],
      showUsers: false,
    }
  }

  async componentDidMount(){ // requisicoes http por que só é executado apenas uma vez no componente
    const res = await fetch (
      'https://randomuser.me/api/?seed=rush&nat=br&results=10'
    );

    const json = await res.json();
    console.log(json)
  }

  componentDidUpdate(){
    console.log(' componentDidUpdate de App.js')
  }

  componentWillMount(){
    console.log(' componentWillMount de App.js')
  }



  render() {

    return (
    <div>
      <div className="padding default-flex-row">
        <span className="small material-icons">check</span>
        <span>React e Class Components</span>
      </div>
    </div>

    )
  }
}
